  return (
    <FormContainer>
      <InvoiceForm invoiceData={invoiceSchema} />{' '}
    </FormContainer>
  );
};

export default CreateInvoice;

const FormContainer = styled.div`
  position: absolute;
  width: 600px;
  height: 100vh;
  padding: 30px 30px 30px 130px;
  border-radius: 0 25px 25px 0;
  background: white;
  z-index: 2;
